import React from 'react';
import {Swiper,SwiperSlide} from 'swiper/react';
import Logo from './logo1.jpg'
import SwiperCore, { EffectCoverflow } from 'swiper';

import 'swiper/swiper-bundle.css';
SwiperCore.use([EffectCoverflow]);



function Testimonial(){
   return (
    <Swiper 
    effect="coverflow"
    slidesPerView='auto'
  
   centeredSlides='true'
    
  
    
  
  >
    <SwiperSlide style={{width:"20rem",height:"23rem"}} >
        <div style={{width:"20rem",height:"20rem",boxShadow:" 1px 1px 5px gray",marginTop:"1rem",marginBottom:"1rem"}}>
        <img src={Logo} style={{width:"5rem",height:"5rem",left:"37%",position:"absolute",borderRadius:"50%"}}/>
        </div>
        
    </SwiperSlide>
    <SwiperSlide style={{width:"25rem",height:"25rem"}} >
        <img src={Logo} style={{width:"25rem",height:"25rem",}}></img>
    </SwiperSlide>
    <SwiperSlide style={{width:"25rem",height:"25rem"}} >
        <img src={Logo} style={{width:"25rem",height:"25rem",}}></img>
    </SwiperSlide>
    <SwiperSlide style={{width:"25rem",height:"25rem"}} >
        <img src={Logo} style={{width:"25rem",height:"25rem",}}></img>
    </SwiperSlide>

  </Swiper>
      
    )
       
   
}

export default Testimonial;
